<template>
  <div class="aiQuality">
    <MyHeader name="AI质检" left="arrow-left" @goBackEv="goBackFn" />
    <div class="qualityList">
      <div
        class="qualityItem"
        v-for="(item, index) in qualityList"
        :key="index"
      >
        <div class="title">
          <i class="iconfont icon-quanbu"></i>
          <h4>{{ item.qualityNameParent }}</h4>
        </div>
        <div class="content">
          <div
            class="childItem"
            :class="child.isHasPhoto == '0' ? 'hasPhoto' : ''"
            v-for="(child, cIndex) in item.children"
            :key="cIndex"
            @click="clickChildItem(child)"
          >
            <span>{{ child.qualityName }}</span>
          </div>
        </div>
      </div>
    </div>
    <!-- 照片弹出层 -->
    <van-popup v-model="photoShow" class="photoShow">
      <img
        :src="imgSrc"
        alt="图片Base64编码"
        style="max-width: 100%; max-height: 2000px"
      />
    </van-popup>
  </div>
</template>

<script>
import { reqYwjsAIQualityList } from '@/http/button'
export default {
  name: 'AiQuality',
  data () {
    return {
      qualityList: [],
      photoShow: false,
      imgSrc: "",
    }
  },
  methods: {
    // 回退
    goBackFn () {
      this.$router.go(-1)
    },
    // 获取质检图片
    clickChildItem (child) {
      // region
      /* let uniqueIdentification = this.$route.query.uniqueIdentification
      let qualityName = child.qualityName
      this.imgSrc = "data:image/webp;base64,"
      this.photoShow = true */
      // endregion

    },
    // 获取质检条目
    async getQualityList () {
      let siteName = ""
      let uniqueIdentification = this.$route.query.uniqueIdentification
      let phySiteId = ""
      let result = await reqYwjsAIQualityList(JSON.stringify({ siteName, uniqueIdentification, phySiteId }))
      console.log('获取质检条目结果', result)

      if (result.operationSuccessFlag) {
        // 获取质检条目集合
        // 获取质检条目父节点
        let parentNodes = []
        result.qualityNameList.forEach(item => {
          parentNodes.push(item.qualityNameParent)
        });
        parentNodes = Array.from(new Set(parentNodes))
        let arr1 = []
        parentNodes.forEach(parent => {
          let obj = {}
          obj.qualityNameParent = parent
          arr1.push(obj)
        })
        this.qualityList = arr1

        // 将质检条目存入对应质检条目父节点
        this.qualityList.forEach(parent => {
          let children = []
          result.qualityNameList.forEach(item => {
            if (parent.qualityNameParent == item.qualityNameParent) {
              let obj = {}
              obj.qualityName = item.qualityName
              obj.isHasPhoto = item.isHasPhoto
              children.push(obj)
            }
          })
          this.$set(parent, "children", children)
        })


      }

    },
  },
  created () {
    // 获取质检条目
    this.getQualityList()
  }

}
</script>

